import React, {useState} from "react";


import "../ToDoList.css";

const ToDo = ({todo}) => {

  const [isOpen, setIsOpen] = useState(false);

  return (
    <div >
      <button 
        className={
          `Card ${isOpen ? 'Card' : 
          todo.task==null ? 'Empty-Card' : 'Card'}`}
        onClick={setIsOpen(`${isOpen ? false : true}`)}
      >
          {`${todo.task == null ? 'Untitled' : todo.task}`}
      </button>
    </div>

  );
};

export default ToDo;
